    default: m.IndexLoginHtml,
  }))
);
/*  */
export const RouterLogin = () => {
  return (
    <Route
      path="/"
      element={
        <Suspense fallback={<div>Loading...</div>}>
          <IndexLogin />
        </Suspense>
      }
    />
  );
};
